/* harmony default export */ __webpack_exports__["default"] = ("<div class=\"student-vision\">\n   <div class=\"breadcrum position-relative float-left w-100 mb-5\">\n      <h3 class=\"title-txt text-center w-100 float-left text-white\">Principal's Desk</h3>\n   </div>\n   <div class=\"container mb-5\">\n      <div class=\"row\">\n         <div class=\"col-12 col-md-6 text-center mb-3 logo-wrapper\">\n            <img src=\"./assets/images/desk/principals-desk.jpg\" class=\"mb-3 w-75\" alt=\"Chairman's Desk\">\n         </div>\n         <div class=\"col-12 col-md-6\">\n            <div class=\"abt-title\">\n               <h2>PRINCIPAL'S DESK</h2>\n            </div>\n            <div class=\"about-desc\">\n               <p>Greetings! I would like to take this opportunity to welcome all to POSTE PODAR LEARN SCHOOL. As principal, I am very excited about this year as our students continue to progress and our programs refine each year. I am confident that this year will be more eventful.</p>\n               <p>Ours is an open, welcoming and supportive learning community. Numerous challenges allure us with limitless opening as we enter new school year. Chance of better options emerges from the invigorating memories of what has been a remarkable beginning. Now is the time to look ahead and nurture ideas for future. During the course of current session our school intends to become recognized as the premier school engaged in the art of promoting excellence in education for gifted children of rural community to advance their learning and enhance their personal development. We look forward to partner and share a vision of eventful journey based on happiness, compassion and opportunity for all.</p>\n               <p>We are hopeful that our efforts will impact our students and hasten their evolution to reliable global citizens of tomorrow. We guide our students to face the world with empathetic attitude and derive an outlook that appreciates and accepts diversity of opinions with equanimity.</p>\n\n               <p class=\"text-right mb-0\"><span>Best wishes,</span></p>\n               <p class=\"text-right mb-0\"><span>Mr. Suryakant Chavale,</span></p>\n               <p class=\"text-right mb-0\"><span>Principal,</span></p>\n               <p class=\"text-right mb-0\"><span>POSTE PODAR LEARN SCHOOL UDGIR </span></p>\n            </div>\n         </div>\n      </div>\n   </div>\n</div>");

